param=struct;
feasTol = getCobraSolverParams('LP', 'feasTol');
param.('feasTol')= feasTol;
param.('epsilon')=feasTol*100;
param.('modeFlag')=0;
param.('method')='fastcc';

% initialize COBRA Toolbox and parallel pool
global CBT_LP_SOLVER
if isempty(CBT_LP_SOLVER)
    initCobraToolbox
end
solver = CBT_LP_SOLVER;
if numWorkers>0 && ~isempty(ver('parallel'))
    % with parallelization
    poolobj = gcp('nocreate');
    if isempty(poolobj)
        parpool(numWorkers)
    end
end
environment = getEnvironment();

cd('Comparison_other_GEMs')

for i=1:size(resources_folders,1)
    dInfo = dir(fullfile(resources_folders{i,1}, '**/*.*'));  %get list of files and folders in any subfolder
    dInfo = dInfo(~[dInfo.isdir]);
    models={dInfo.name};
    models=models';
    
    % remove any files that are not mat files
    delInd=find(~any(contains(models(:,1),{'.mat','.xml','.sbml'})));
    models(delInd,:)=[];

    Resource = resources_folders{i,2};
    if length(models)>200
        steps=100;
    else
        steps=25;
    end

