                case 'BiGG'
                    model.rxns=strrep(model.rxns,'Growth','biomass');
                    model.rxns=strrep(model.rxns,'R_ATPM','DM_atp_c_');
                    model.rxns=strrep(model.rxns,'ATPM','DM_atp_c_');
                    % add ATP demand if not present
                    if isempty(find(contains(model.rxns,'DM_atp_c_'), 1))
                        model=addReaction(model,'DM_atp_c_','atp[c] + h2o[c] -> adp[c] + h[c] + pi[c]');
                    end

                    % modify biomass reaction name
                    if isempty(find(strncmp(model.rxns,'bio',3)))
                        bio=find(contains(model.rxns,'bio'));
                        if isempty(bio)
                            bio=find(contains(model.rxns,'Bio'));
                        end
                        if isempty(bio)
