                SInConsistentRxnBool(exRxns,:)=[];
                tmpSFConsist{j}(1)=sum(SConsistentRxnBool);
                tmpSFConsist{j}(2)=sum(SConsistentRxnBool)/length(model.rxns);
            end
        end

        for j=s:s+endPnt
            stats.(Resource)(j,1)=tmpStats{j}(1);
            stats.(Resource)(j,2)=tmpStats{j}(2);
            stats.(Resource)(j,3)=tmpStats{j}(3);
            atp.(Resource)(j,1)=tmpATP{j}(1);
            atp.(Resource)(j,2)=tmpATP{j}(2);
            try
                SFconsist.(Resource)(j,1)=tmpSFConsist{j}(1);
                SFconsist.(Resource)(j,3)=tmpSFConsist{j}(3);
            end
            SFconsist.(Resource)(j,2)=tmpSFConsist{j}(2);
            SFconsist.(Resource)(j,4)=tmpSFConsist{j}(4);
        end
    
    save([rootDir filesep 'Comparison_other_GEMs' filesep 'Results' filesep 'Model_statistics]','stats','-v7.3');
    save([rootDir filesep 'Comparison_other_GEMs' filesep 'Results' filesep 'ATP_production'],'atp','-v7.3');
    save([rootDir filesep 'Comparison_other_GEMs' filesep 'Results' filesep 'Stoch_Flux_Consistency'],'SFconsist','-v7.3');
    end
end
